    //     if (error.response){
    //         console.log(error.response)
    //         console.log(error.response.status)
    //         console.log(error.response.headers)
    //     }
    //     })
    // }

    // function getGoals() {
    //     axios({
    //         method: "GET",
    //         url: "http://127.0.0.1:5000/getGoals"
    //     })
    //     .then((response) => {
    //         const res = response.data
    //         setGoals(
    //             res.goals
    //         )
    //     } )
    //     .catch((error) => {
    //     if (error.response){
    //         console.log(error.response)
    //         console.log(error.response.status)
    //         console.log(error.response.headers)
    //     }
    //     })
    // }

    // function getSecrets() {
    //     axios({
    //         method: "GET",
    //         url: "http://127.0.0.1:5000/getSecrets"
    //         // getSecrets 함수를 main.py에서 만들어야돼 
    //     })
    //     .then((response) => {
    //         const res = response.data
    //         setSecrets(
    //             res.secrets
    //         )
    //     } )
    //     .catch((error) => {
    //     if (error.response){
    //         console.log(error.response)
    //         console.log(error.response.status)
    //         console.log(error.response.headers)
    //     }
    //     })
    // }

    // function getInstructions() {
    //     axios({
    //         method: "GET",
    //         url: "http://127.0.0.1:5000/getInstructions"
    //         // getInstructions 함수를 main.py에서 만들어야돼 
    //     })
